  limited attention by American astacologists. This document represents the first
  report of a multiyear effort to document the crayfish fauna of Okefenokee Wildlife
  Refuge. Please consider this a pilot study, and not a formal report of findings.
  Collecting efforts were associated with West Liberty State Collegeu2019s annual
  spring break trip to Stephen C. Foster State Park during 2006 and 2007.\",\n\t\"owner_org\":
